Kate Medina-Two Little Girls

Two little girls walked to their deaths and nobody noticed&#x2026;A gripping new thriller featuring the brilliantly complex psychologist Dr Jessie Flynn, who struggles with a dark past.Two bodies on the beach. One killer out for revenge.Two years ago, a young girl was murdered while playing on the beach, a doll left by her side. DI Bobby &#x2018;Marilyn&#x2019; Simmons failed to catch her killer and he&#x2019;s been tormented with guilt ever since.So when another dead girl is found in the dunes, another doll, he knows this could be his only chance to silence his demons.Psychologist Dr Jessie Flynn is called in to help with the investigation. But she&#x2019;s being led into a web of lies and deceit by a new patient called Laura &#x2013; a deeply disturbed woman who wants Jessie as her friend.
When links emerge between Laura and the two dead girls, Jessie&#x2019;s worst nightmare becomes reality. For in the dark world of a twisted killer, she begins to realize just how treacherous friends can be&#x2026;
